		mx = int(math.sqrt(max(query)))
		prime = [True] * (mx + 1)
		for i in range(2, mx + 1):
			if prime[i]:
				j = i + i
				while j <= mx:
					prime[j] = False
					j += i
		count = [0] * (mx + 1)
		for i in range(2, mx + 1):
			count[i] += count[i - 1]
			if prime[i]:
				count[i] += 1
		ans = []
		for i in range(q):
			a = int(math.sqrt(query[i]))
			ans.append(count[a])
		return ans
