	def isScramble(self, S1: str, S2: str) -> bool:

		@lru_cache(maxsize=None)
		def isScrambled(S1: str, S2: str) -> bool:
			if S1 == S2:
				return True
			s = ''.join(sorted(S1))
			t = ''.join(sorted(S2))
			if s != t:
				return False
			length = len(S1)
			for i in range(1, length):
				if isScrambled(S1[:i], S2[:i]) and isScrambled(S1[i:], S2[i:]):
					return True
				if isScrambled(S1[:i], S2[length - i:]) and isScrambled(S1[i:], S2[:length - i]):
					return True
			return False
		return isScrambled(S1, S2)
